import { CVData } from '../../types/CVTypes';

export class CVService {
  static async getCVById(id: string): Promise<CVData> {
    // هذه بيانات تجريبية، يجب استبدالها بطلب API حقيقي
    return {
      personalInfo: {
        fullName: "أحمد محمد",
        title: "مطور برمجيات",
        email: "ahmed@example.com",
        phone: "+966 50 123 4567",
        location: "الرياض، المملكة العربية السعودية"
      },
      summary: "مطور برمجيات ذو خبرة 5 سنوات في تطوير تطبيقات الويب باستخدام React و TypeScript",
      experience: [
        {
          title: "مطور واجهات أمامية أول",
          company: "شركة التقنية المتقدمة",
          period: "2020 - الحالي",
          description: [
            "تطوير وصيانة تطبيقات الويب باستخدام React و TypeScript",
            "تحسين أداء التطبيقات وتقليل وقت التحميل بنسبة 40%",
            "قيادة فريق من 3 مطورين"
          ]
        }
      ],
      education: [
        {
          degree: "بكالوريوس علوم الحاسب",
          institution: "جامعة الملك سعود",
          period: "2015 - 2019",
          details: "تخرج بتقدير امتياز مع مرتبة الشرف"
        }
      ],
      skills: [
        "React",
        "TypeScript",
        "Node.js",
        "GraphQL",
        "Material-UI"
      ]
    };
  }

  static async saveCV(cv: CVData): Promise<void> {
    // هنا يتم حفظ السيرة الذاتية عبر API
    console.log('Saving CV:', cv);
  }
}
